import React from 'react';
import WorkCard from './WorkCard';

const Work = () => {
    return (
        <div>
            <div className="columns-3 gap-4">
                {[24, 32, 40, 32, 32, 32, 16, 16, 64].map((height, index) => (
                    <div
                    key={index}
                    >
                        <WorkCard
                            height = {height}
                        />
                    </div>
                ))}
            </div>
        </div>

    );
}

export default Work;
